import React from 'react';
import { View } from 'react-native';

import colors from '../styles/colors';
import { styles } from '../styles/styles';
import Detail from '../components/item/Detail';

const StoreDetails = () => {
    const { bg_light, container, p_15, rounded } = styles;
    const { darkGrey } = colors;

    return (
        <View style={[bg_light, container, p_15, rounded]}>
            <Detail title="Account Number" value='accountNumber' />
            <Detail title="Slot Number" value='slotNumber' />
            <Detail title="Size" value='size' />
            <Detail title="Rental Fee" value='rentalFee' />
            <Detail title="Start Date" value='startDate' />
            <Detail title="End Date" value='endDate' />
        </View>
    );
}

export default StoreDetails;
